        public string NestedDictIteration(Dictionary<int, Dictionary<int, Electrode>> nestedDict)
        {
            string result = "";
            foreach (int key in nestedDict.Keys)
            {
                object nextLevel = nestedDict[key];
                if (nextLevel == null)
                {
                    continue;
                }
                result += string.Format("[Key = {0}, Value = {1}]", key, NestedDictIteration((Dictionary<int, Electrode>)nextLevel));
            }
            return result;
        }

        public string NestedDictIteration(Dictionary<int, Electrode> nestedDict)
        {
            string result = "";
            foreach (int key in nestedDict.Keys)
            {
                object value = nestedDict[key];
                if (value == null)
                {
                    continue;
                }
                result += string.Format("[Key = {0}, Value = {1}]", key, value);
            }
            return result;
        }
